      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE col1 + - 98 - - + col2 * 91 * + ( - col1 ) * + col0 NOT IN ( - CAST ( NULL AS INTEGER ) + - col2 );
  - name: tab2

outputs:
  - name: q9093.out
    data: |
